import Team from "./Team";

const Teams = ({ teams, onDelete }) => {
  return (
    <>
      {teams.map((teamName, index) => (
        <Team key={index} name={teamName} onDelete={onDelete} />
      ))}
    </>
  );
};

export default Teams;
